import { useParams } from 'react-router-dom';
import { streamVideo } from '../api';

const VideoPlayer = () => {
  const { id } = useParams();
  const videoSrc = streamVideo(id);

  return (
    <div>
      <h2>Video Player</h2>
      <video controls>
        <source src={videoSrc} type="video/mp4" />
        Your browser does not support the video tag.
      </video>
    </div>
  );
};

export default VideoPlayer;
